        public products?: Array<OrderProducts>, 
        public totalItems?:number, 
        public itemsSubTotal?:number, 
        public shipmentCharges?:number, 
        public totalAmount?:number, 
        public paymentStatus?:string, 
        public paymentMethodTitle?:string, 
        public email?:string
    ){}

}

